export function CardContainer () {

    const dogs = useSelector(state => state.dogsLoaded)

    

    return (

        <>
        {dogs.length >= 1 && dogs.slice(base, paginate).map(dog => {
                    return (
                    <DogCard
                    dog={dog}

                    />
        )})}
    

        
        </>
    )
}
